function PopupWithForm(props) {
  return (
    <div
      className={
        props.isOpen
          ? `popup ${props.popupName}`
          : `popup ${props.popupName} popup-hidden`
      }
    >
      <div className="popup__container">
        <button
          onClick={props.onClose}
          className={`${props.popupName}__close-button popup__close-button`}
          type="button"
        ></button>
        <form
          className="popup__form profile-form form"
          name="profileForm"
          noValidate
        >
          <h2 className="form__heading">{props.title}</h2>
          <fieldset className="profile-form__fieldset form__fieldset">
            {props.children}
          </fieldset>
        </form>
      </div>
    </div>
  );
}

export default PopupWithForm;
